import "./intro.css";

import { FaAward } from "react-icons/fa";
import React from "react";
import { VscFolderLibrary } from "react-icons/vsc";
import img from "../../assets/Me.webp";
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import { MDBContainer, MDBRow, MDBCol } from 'mdb-react-ui-kit';

const Intro = () => {
  return (


    <MDBRow>
      <MDBCol md="8">
        <FaAward className="about__icon" />
        <h3 class="cv">Education</h3>
        <p class="cv"><strong>Victoria University of Wellington</strong><br />
          July 2023 - present | Wellington, NZ<br />
          M.S. in Software development</p >

        <h4>Boston University</h4>
        <p>Master of Science, Statistics</p>
        <p>2015 - 2016</p>

      </MDBCol>

      <MDBCol md="8">
        <VscFolderLibrary className="about__icon" />
        <h3 class="cv">Work Experience</h3>
        <p class="cv"><strong>Li Auto</strong><br />
          Dec 2020 - May 2023 | Beijing, China<br />
          Data Scientist</p >

        <p class="cv"><strong>Ai Bank</strong><br />
          Dec 2018 - Nov 2020 | Beijing, China<br />
          Data Analyst</p > 
      </MDBCol>

    </MDBRow>



  );
};

export default Intro;
